import styled from 'styled-components'

export const Button = styled.button`
    background: white;
    border: 1px solid #09f;
    border-radius: 5px;
    cursor: pointer;
    font: normal 600 1em/5px "Works Sans" sans-serif;
    margin: 1em;
    padding: 4px 12px;
`
